description.text:
I wanted to run Jetty's accelerated firmware ( <a rel="nofollow" href="http://www.thingiverse.com/thing:15380" >http://www.thingiverse.com/thing:15380</a> ) but at the time it required the LCD* ( <a rel="nofollow" href="http://www.makerbot.com/docs/makerbot-gen4-interface-kit/" >http://www.makerbot.com/docs/makerbot-gen4-interface-kit/</a> ). So I went to buy one from MakerBot, but it is discontinued.
Well . . . why not hack** one up?
All the parts are less than $60.
Fair warning, I have an interest in Crystalfontz which is why I got the LCD there :) The rest of the parts have Digi-Key links in the BOM.
The case is printable on a CupCake or TOM, but the slicing I did is horrible. Hopefully someone will care enough to fix the slicing. What I have works, it just looks like a certain Mary Shelley lead character.
You will need:<br />
) the parts on the BOM<br />
) wire ( you can strip a USB cable like I did)<br />
) soldering iron &amp; solder<br />
) heat shrink

<li >No LCD version now available:  <a rel="nofollow" href="http://www.thingiverse.com/thing:17855" >http://www.thingiverse.com/thing:17855</a> )</li>

** I do mean HACK, this is the sloppiest SCAD + slice + print + glue + wiring ever! Blech!
